import React, {useEffect, useState} from "react";
import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";
import s from "./Login.module.css";
import imagecol from "./login_image.png";
import { NavLink } from "react-router-dom";
import Cabinet from "../UserCabinet/Cabinet";
import { useHistory } from 'react-router-dom';


export default function Login({setIsLoggedIn, isLoggedIn}) {
    const [Email, setEmail] = useState("");
    const [Password, setPassword] = useState("");
    const history = useHistory();
    // const [loading, setLoading] = useState(true);
    // const [statusCode, setStatusCode] = useState(null);
    useEffect(() => {
        if(localStorage.getItem('user-info') && isLoggedIn == true){
            history.push("/cabinet")
        }
    }, [])

    function validateForm() {
        return Email.length > 0 && Password.length > 0;
    }

    async function myLoginAPI(e) {
        e.preventDefault();
        let item = {Password, Email};
        // try{
        let result = await fetch("https://craftcutstestapiproject20211120225609.azurewebsites.net/api/Customer/Auth", {
            method: 'POST',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
            },
            body: JSON.stringify({Email: Email, Password: Password}),
        });
            console.log({Email, Password});
            result = await result.json();
            // setLoading(false);
            // setStatusCode(result.status);
        console.log(result.status);


            localStorage.setItem("user-info", JSON.stringify(result));
        console.log(result.status);

            localStorage.setItem('isLoggedIn', true);
        console.log(result.status);

            setIsLoggedIn(true);
        console.log(result.status);

            history.push("/cabinet")
        console.log(result.status);

            console.log(result);
            console.log(result.status);


            console.log("Dibil, takogo uzera nety")

        // }
        // catch (e){
        //     // ответ получен, но нет статуса ответа (смотри консоль)
        //     if (!loading && !statusCode) {
        //         console.log("Something went wrong. See console logging.");
        //     }
        //
        //     // ответ получен, статус 200
        //     if (statusCode === 200) {
        //         console.log("All good");
        //     }
        //
        //     // ответ получен, статус 404
        //     if (statusCode === 404) {
        //         console.log("Status 404 oleg");
        //     }
        // }
    }


    async function myLoginAPI1(e) {
        e.preventDefault();
        let item = {Password, Email};
        // try{
        let result = await fetch("https://craftcutstestapiproject20211120225609.azurewebsites.net/api/Customer/Auth", {
            method: 'POST',
            headers: {
                "Content-Type": "application/json",
                "Accept": "application/json",
            },
            body: JSON.stringify({Email: Email, Password: Password}),
        });
        if(result.status != null){


        console.log({Email, Password});
        result = await result.json();
        localStorage.setItem("user-info", JSON.stringify(result));
        localStorage.setItem('isLoggedIn', true);
        setIsLoggedIn(true);
        history.push("/cabinet")
        console.log(result);
        console.log(result.status);
        }
        else if(result.status == 404){
            console.log();
        }
    }



    return (

        <form onSubmit={myLoginAPI1}>
        <div className={s.row}>
            <div className={s.col_6}>
                <li className={s.item}>
                    <h5 className={s.logo}>
                        Craft Cuts</h5>  </li>
                <h5 className={s.h5welcome}>Добро пожаловать в <span className={s.craftcuts_red}>Craft Cuts</span>
                </h5>
                <h1 className={s.login}>Войти</h1>
                <div className={s.Login}>
                    <input type="text" placeholder="email" onChange={(e)=>setEmail(e.target.value)} className="s.email_input"/>
                    <input type="text" placeholder="password" onChange={(e)=>setPassword(e.target.value)} className="s.password_input"/>
                    <button type="submit" className={s.btn_login}>Login </button>
                    {/*<button onClick={myLoginAPI} className={s.btn_login}>Login</button>*/}
                    {/*<NavLink to = "/cabinet" block size="lg" className={s.btn_login}>*/}
                    {/*    Login*/}
                    {/*</NavLink>*/}

                </div>
            </div>
            <div className={s.col_6}>
                <div className={s.img_block}>
                    <img className = {s.imagecol} src={imagecol} alt="image_left"></img></div>
            </div>
        </div>
        </form>
    );
}
